import {
  createBrowserRouter,
  RouterProvider
} from "react-router-dom" 
import Home from "/routes/Home";
import Detail from "/routes/Detail";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
  },
  {
    path: "/",
    element: <Detail />,
  } 
]);

function App() {
  return <createBrowserRouter router={router}/>
}

export default App;
